import React, { useState, setState } from "react";
import "./WrapperBack.css";
import Card from "./Card";
import Bottom from "./Bottom";
import data from "../data.json";
import {
  FaCaretDown,
  FaCaretUp,
  FaCaretLeft,
  FaCaretRight,
} from "react-icons/fa";
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";

const wstyles = {
  height: "100%",
  width: "100%",
  position: "relative",
};

const cstyles = {
  height: "100%",
  width: "100%",
  position: "relative",
};

const WrapperBack = () => {
  return (
    <div className="div-wrapper">
      <TransformWrapper>
        <div id="bg" className="outer-wrap back">
          <TransformComponent wrapperStyle={wstyles} contentStyle={cstyles}>
            <div className="card-wrapper back">
              <img className="pic" src={`./shoes/1.jpg`} />
            </div>
          </TransformComponent>
          <div className="card-wrapper back">
            <img className="pic" src={`./shoes/2.jpg`} />
          </div>
          <div className="card-wrapper back">
            <img className="pic" src={`./shoes/3.jpg`} />
          </div>
          <div className="card-wrapper back">
            <img className="pic" src={`./shoes/4.jpg`} />
          </div>
        </div>
      </TransformWrapper>
    </div>
  );
};

